    return(
        <div className="wrapper">
            <div className = "button-sort">{value}</div>
            <div className = "select-inside">
                {
                    props.values.map((el)=> {
                        return <div>{el}</div>
                    })
                }
            </div>
        </div>
    )
}

export default Select
